const container = document.getElementById('container');
const canvas = document.getElementById('canvas1');
const file = document.getElementById('fileupload');
canvas.width = window.innerWidth;
canvas.height = window.innerHeight;
const ctx = canvas.getContext('2d');
let audioSource; 
let analyser;

container.addEventListener('click', function(){
  const audio1 = document.getElementById('audio1');
  audio1.src = 'data:audio/x-wav;base64,' 
const audioContext = new AudioContext();
  audio1.play();
  audioSource = audioContext.createMediaElementSource(audio1); // makes audio1 from line 1 the source 
  analyser = audioContext.createAnalyser(); // shows audio time & frequency data
  audioSource.connect(analyser);
  analyser.connect(audioContext.destination);   // default output device aka computer speakers
  analyser.fftSize = 64; // number of audio samples wanted in the analszer data file
  const bufferLength = analyser.frequencyBinCount;  // contains number of data values in the analyser data file
  const dataArray = new Uint8Array(bufferLength);

 const barWidth = canvas.width/bufferLength; //  barWidth = width of a single bar in the visualizer. bufferLenth = amount of details about frequencies that shows in the analyser sound file
let barHeight; // let variable cause it will change value in response to the music
let x;

function animate() {
  x = 0;
  ctx.clearRect(0,0, canvas.width, canvas.height); // clears entire canvas
  analyser.getByteFrequencyData(dataArray);
  for (let i = 0; i < bufferLength; i++){
    barHeight = dataArray[i] *2;
    ctx.fillStyle = 'white';
    ctx.fillRect(x, canvas.height - barHeight, barWidth, barHeight);
    x += barWidth;
  }
  requestAnimationFrame(animate);
}
animate();
});

file.addEventListener('change', function(){
  const files = this.files;
  const audio1 = document.getElementById('audio1');
  audio1.src = URL.createObjectURL(files[0]);
  audio1.load();
  audio1.play();
  audioSource = audioContext.createMediaElementSource(audio1); // makes audio1 from line 1 the source 
  analyser = audioContext.createAnalyser(); // shows audio time & frequency data
  audioSource.connect(analyser);
  analyser.connect(audioContext.destination);   // default output device aka computer speakers
  analyser.fftSize = 64; // number of audio samples wanted in the analszer data file

  const bufferLength = analyser.frequencyBinCount;  // contains number of data values in the analyser data file
  const dataArray = new Uint8Array(bufferLength);

 const barWidth = canvas.width/bufferLength; //  barWidth = width of a single bar in the visualizer. bufferLenth = amount of details about frequencies that shows in the analyser sound file
let barHeight; // let variable cause it will change value in response to the music
let x;

function animate() {
  x = 0;
  ctx.clearRect(0,0, canvas.width, canvas.height); // clears entire canvas
  analyser.getByteFrequencyData(dataArray);
 
  requestAnimationFrame(animate);
}
animate();
});

function drawVisualizer(bufferLength, x, barWidth, dataArray){
  for (let i = 0; i < bufferLength; i++){
    barHeight = dataArray[i] *2;
    ctx.fillStyle = 'white';
    ctx.fillRect(x, canvas.height - barHeight, barWidth, barHeight);
    x += barWidth;
  }
}
